    ::-webkit-scrollbar {
        display: none;
    }
    -ms-overflow-style: none;
    scrollbar-width: none;
}

a {
    text-decoration: none;
}

li {
    list-style: none;
}

.contenedor {
    width: 90%;
    max-width: 1200px;
    margin: auto;
}

html, body {
    height:auto!important;
    max-width: 100vw;
    overflow-x: hidden;
}

@media only screen and (min-width: 768px) {
    html, body {
        scroll-behavior: smooth;
    }
}

