.navbar {
    background-color: $white;
    border-bottom: 1px solid #fff;
    z-index: 2;
    position: fixed;
    top: 0;
    width: 100vw;
    height: 6vh;
    min-height: 60px;

    .navbar__container {
        display: flex;
        img {
            display: none;
        }

        .navbar__options {
            display: flex;
            justify-content: space-between;
            width: 80vw;
            min-width: 290px;
            position: absolute;
            top: 50%;
            transform: translateY(-50%);
            left: 10vw;
            list-style-type: none;

            li {
                position: relative;
            

                a {
                    text-decoration: none;
                    color: $black;
                    @extend %text;
                }

                a:hover {
                    color: black;
                }

                a::before {
                    content: "";
                    display: block;
                    position: absolute;
                    top: 3vh;
                    height: 4px;
                    width: 0%;
                    background: $lightGradient;

                    transition: all ease-in-out 250ms;
                }

                a:hover::before {
                    width: 100%;
                }
            }
        }
    }
}

.carousel {
    position: relative;
    height: 100vh;
    width: 80vw;
    margin: 0 auto;

    .carousel__button {
    position: absolute;
    top: 50%;
    transform: translateY(-50%);
    background: transparent;
    border: 0;
    cursor: pointer;
    img {
        width: 15px;
    }
    }

    .carousel__button--left {
    left: -20px;
    }

    .carousel__button--right {
    right: -20px;
    }

    .carousel__nav {
    display: flex;
    justify-content: center;
    padding: 10px 0;
    position: relative;
    top: -5%;
    .carousel__indicator {
        border: 0;
        border-radius: 50%;
        width: 15px;
        height: 15px;
        background: rgba(0, 0, 0, 0.3);
        margin: 0 10px;
        cursor: pointer;
    }
    .carousel__indicator.current-slide {
        background: rgba(0, 0, 0, 0.75);
    }
    }

    .carousel__track-container {
    height: 100%;
    position: relative;
    overflow: hidden;
    .carousel__track {
        list-style: none;
        position: relative;
        height: 100%;
        transition: transform 250ms ease-in-out;
        .carousel__slide {
            position: absolute;
            top: 0;
            bottom: 0;
            width: 100%;
            .carousel__text {
                position: absolute;
                top: 10%;
                left: 0;
                width: 70%;
                height: 90vh;
                .carousel__cta {
                    position: relative;
                    top: 10%;
                    @extend %footer;
                    @extend %ctaHome;
                }
                .carousel__text--title {
                @extend %bigHeader;
                }
                .carousel__text--description {
                @extend %subHeader;
                padding-top: 20%;
                padding-bottom: 10%;
                }
                .carousel__text--detail {
                    @extend %text;
                    background-color: rgba(255, 255, 255, 0.9);
                }
            }

            .carousel__precio {
                display: flex;
                position: absolute;
                top: 10vh;
                right: 0vw;
                width: 3vw;
                min-width: 100px;
                justify-items: center;
                align-items:center;
                h6 {
                    @extend %text;
                    color: $black;
                    width: 90px;
                    text-align:right;
                    z-index: 1;
                    display: flex;
                    position: relative;
                }
                .carousel__precio--img {
                    width: 100%;
                    display: none;
                    position: relative;
                    transform: translateX(-70%);
                }
            }



            .carousel__image {
                z-index: 0;
                width: 100%;
                height: 100%;
                top: 0;
                object-fit: cover;
            }
        }
    }
    }

    .is-hidden {
    display: none;
    }
}

.background {
    display: flex;
    position: absolute;
    z-index: -1;
    justify-self: center;
    width: 100vw;
    height: auto;
    overflow: hidden;
}

.background--servicios {
    top: 105vh;
    left: 0;
    width: 100vw;
    height: 100vh;
    img {
        width: auto;
        height: 100%;
        transform: translateX(-80%);
    }
}

.background--contacto {
    top: 200vh;
    width: 100vw;
    height: 100vh;
    right: -10vw;
    img {
        width: auto;
        height: 100%;
        transform: translateX(30%);
    }
}

.servicios {
    position: relative;
    height: 94vh;
    min-height: 850px;
    width: 90vw;
    margin: 0 auto;
    top: 5vh;

    .servicios__title {
        @extend %header;
        font-size: 34px;
        text-transform: uppercase;
        position: relative;
        height: 41px;
        width: 100%;
        top: 10%;
        text-align: center;
        h1 {
            vertical-align: middle;
        }
    }
    .servicios__container {
        position: relative;
        top: 10%;
        left: 0;
        width: 100%;
        height: 85vh;
        display: grid;
        grid-template-columns: 1fr;
        grid-template-rows: 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr;
        grid-gap: 1%;

        .servicios__card {
            height: 100%;
            min-height: 50px;
            width: 100%;
            display: grid;
            grid-template-columns: 1fr 3fr;
            grid-template-rows: 1fr;
            grid-template-areas: "icon title";
            align-items: center;
            justify-content: center;
            background-color: rgb(255, 255, 255);
            box-shadow: 1px 4px 8px rgba(0, 0, 0, 0.25);
            border-radius: 4px;

            .card__img {
                display: none;
                img {
                    @extend %cardImg;
                }
            }

            .card__icon {
                grid-area: icon;
                .card__icon--small {
                img {
                    width: 80%;
                    max-height: 30px;
                    margin-left: 10%;
                    top: 50%;
                    left: 50%;
                }
                }

                .card__icon--big {
                    display: none;
                }
            }

            .card__text {
            white-space: nowrap;
            grid: "title";
            h4 {
                justify-content: center;
                align-content: center;
                text-align: start;
                @extend %subHeader;
            }
            h6 {
                display: none;
                @extend %footer;
            }
        }
        }
    }
}

.contacto {
    position: relative;
    height: 94vh;
    min-height: 900px;
    width: 80vw;
    margin: 0 auto;
    top: 5vh;
    .contacto__title {
    @extend %header;
    text-transform: uppercase;
    position: relative;
    height: 41px;
    width: 100%;
    top: 10%;
    text-align: center;
    }

    .contacto__container {
    position: relative;
    top: 10%;
    left: 0;
    width: 100%;
    height: 80vh;
    min-height: 600px;
        .contacto__left {
            .mensaje__contacto {
                padding-top: 2vh;
                .message {
                    padding-top: 10%;
            }
            }
            .contact-elements {position:relative; width:100%;}
            input.input-field,
            .tel-number-field,
            .textarea-field,
             .select-field{
                -webkit-transition: all 0.30s ease-in-out;
                -moz-transition: all 0.30s ease-in-out;
                -ms-transition: all 0.30s ease-in-out;
                -o-transition: all 0.30s ease-in-out; 
                box-sizing: border-box;
                -webkit-box-sizing: border-box;
                -moz-box-sizing: border-box;
                border: 1px solid #C2C2C2;
                box-shadow: 1px 1px 4px #EBEBEB;
                -moz-box-shadow: 1px 1px 4px #EBEBEB;
                -webkit-box-shadow: 1px 1px 4px #EBEBEB;
                border-radius: 3px;
                -webkit-border-radius: 3px;
                -moz-border-radius: 3px;
                padding: 7px;
                outline: none;
            }
            .input-field:focus,
            .tel-number-field:focus,
            .textarea-field:focus,  
            .select-field:focus{
                border: 1px solid #0C0;
            }
            
            
            div.contact, textarea, input {
              -moz-box-sizing: border-box;
              -webkit-box-sizing: border-box;
              box-sizing: border-box;
            }
            
            .contact {
                color:#fff;
                font-family: 'Open Sans', sans-serif;
                font-weight:600;
                line-height:20px;
                }
            .contact h2 {font-size:50px;}
            .headline {
                font-size:50px;
            }
              .center-btn {
                text-align: center;
              }
            .container {
              min-width: 200px;
              height: 100%;
              margin: 0px auto 0px;
              padding-bottom:25px;
              background-color: #fff;
              border: 1px solid #cfcfcf;
            }
            
            .row {
              width: 100%;
              margin: 0 0 1em 0;
              padding: 0 2.5em;
            }
            .row.header {
              padding: 1.5em 2.5em;
              border-bottom: 1px solid #ccc;
              background-color:#63a7d6;
              border-top-left-radius:5px;
              border-top-right-radius:5px;
              text-align:center;
            }
            .row.body {
              padding: 0em 2.5em 1em;
            }
            
            div.contact-elements p.pull-right {
              float: right;
            }
            div.contact-elements p.left {float:left;}
            
            .btn {
              font-size: 1.0625em;
              display: inline-block;
              padding: 0.74em 1.5em;
              margin: 1.5em 0 0;
              color: #fff;
              border-width: 0 0 0 0;
              border-radius:5px;
              text-transform: uppercase;
              background-color: #b3b3b3;
              border-bottom-color: #8c8c8c;
              font-family: 'Lato', sans-serif;
              font-weight: 300;
                box-shadow: 1px 1px 4px #ccc;
                -moz-box-shadow: 1px 1px 4px #ccc;
                -webkit-box-shadow: 1px 1px 4px #ccc;
            }
            .btn:hover {
              background-color: #bfbfbf;
            }
            .btn.btn-submit {
              background-color: #63a7d6;
              border-bottom-color: #374d78;
            }
            .btn.btn-submit:hover {
              background-color: #5f7db6;
            }
            
            .contact-elements {
              max-width: 100%;
              display: block;
            }
            .contact-elements ul {
              margin: 0;
              padding: 0;
              list-style: none;
            }
            .contact-elements ul li {
              margin: 0 0 0.25em 0;
              clear: both;
              display: inline-block;
              width: 100%;
            }
            .contact-elements ul li:last-child {
              margin: 0;
            }
            .contact-elements ul li p {
              margin: 0;
              padding: 0;
              float: left;
            }
            .contact-elements ul li p.right {
              float: right;
            }
            .contact-elements ul li .divider {
                border: 0;
                margin-top: 60px;
              margin-bottom: 15px;
                border-bottom: 1px dashed #ccc;
                background: #eaeaea;
                opacity:.5;
            }
            .contact-elements ul li, .req {
                font-size:15px;
                color:#63a7d6;
                font-variant:small-caps;
                text-transform:lowercase;
                font-weight:bolder;
            }
            .contact-elements label {
              display: block;
              margin: 0 0 0.5em 0;
              color: #4f6fad;
              font-size: 1em;
            }
            .contact-elements input {
              margin: 0 0 0.5em 0;
              border: 1px solid #ccc;
              padding: 6px 10px;
              color: #555;
              font-size: 1em;
            }
