              border: 1px solid #ccc;
              padding: 6px 10px;
              width: 100%;
              color: #555;
              resize:none;
              overflow:auto;
            }
            .contact-elements small {
              color: #4f6fad;
              margin: 0 0 0 0.5em;
            }
        }

        .contacto__right {
            position: relative;
            top: 2%;
