                    width: 250px;
                    height: 180px;
                    img {
                        width: 120px;
                        justify-self: center;
                        align-self: center;
                    }
                    h3 {
                        width: 200px;
                        text-align: center;
                        justify-self: center;
                        align-self: center;
                    }
                }
            }
        }



        .tabla {
            top: 0vh;
            .tabla__section {
                margin: 2em auto;
                .tabla__planes {
                    .tabla__plan__unidad {
                        width: 23%;
                        margin: 0 1.33% 20px 0;
                        transition: all .25s;
                        .tabla__plan__unidad--container {
                            .button {
                                a {
                                    transition: all .25s;
                                }
                                a:hover {
                                    background: $darkGradient;
                                    color: #fff;
                                }
                            }
                        }
                    }
                    .tabla__plan__unidad:hover {
                        transform: scale(1.04);
                    }
                }
            }
        }
        .tabla__section .tabla__planes > li:last-child {
            margin-right: 0;
        }
        .homeoffice__footer {
            top: 25vh;
            height: 50vh;
        }
    }
}

